"use strict";(self.webpackChunkdocusaurus=self.webpackChunkdocusaurus||[]).push([[5369],{8907:(e,t,a)=>{a.r(t),a.d(t,{assets:()=>h,contentTitle:()=>s,default:()=>c,frontMatter:()=>i,metadata:()=>r,toc:()=>l});var n=a(4848),o=a(8453);const i={title:"2024-09-25 Baby Girl Is Here",slug:"2024/baby-girl-is-here",tags:["2024-09","2024","baby girl"],hide_table_of_contents:!0},s=void 0,r={permalink:"/journal/2024/baby-girl-is-here",source:"@site/../journal/2024-09-25-baby-girl-is-here.md",title:"2024-09-25 Baby Girl Is Here",description:"I've been meaning to write but somehow don't seem to have enough time or energy. A lot has happened since last entry. Let's see what I still recall.",date:"2024-09-25T00:00:00.000Z",tags:[{inline:!0,label:"2024-09",permalink:"/journal/tags/2024-09"},{inline:!0,label:"2024",permalink:"/journal/tags/2024"},{inline:!0,label:"baby girl",permalink:"/journal/tags/baby-girl"}],readingTime:3.105,hasTruncateMarker:!0,authors:[],frontMatter:{title:"2024-09-25 Baby Girl Is Here",slug:"2024/baby-girl-is-here",tags:["2024-09","2024","baby girl"],hide_table_of_contents:!0},unlisted:!1,nextItem:{title:"2024-09-05 Our Home",permalink:"/journal/2024/our-home"}},h={authorsImageUrls:[]},l=[];function d(e){const t={code:"code",p:"p",...(0,o.R)(),...e.components};return(0,n.jsxs)(n.Fragment,{children:[(0,n.jsx)(t.p,{children:"I've been meaning to write but somehow don't seem to have enough time or energy. A lot has happened since last entry. Let's see what I still recall."}),"\n",(0,n.jsx)(t.p,{children:"Around 9th Sept or so, Maiko's phone, which we'd bought last year around this time, stopped taking charge. We tried different cables, adapters, restarts, and stuff, but it wouldn't budge. At last, I tried an old new cable, and it started charging and didn\u2019t lose it after a couple of seconds (like it was doing before). I, very carefully, placed it on the table\u2014thinking that if I'm not careful, it might lose charge again. Well, it charged all the way up to 100%. Later, we found that the existing cable had very minute cut marks\u2014most probably cut by Tachan. But the phone didn\u2019t take charge with the other cables we tried and still occasionally shows some issues\u2014so there seems to be some issue with the phone as well."}),"\n",(0,n.jsx)(t.p,{children:"I've been wanting to purchase a new phone for myself; my iPhone is around seven years old at this point. And been inclined to go the Android route (Google Pixel) this time and thought it would be a good time, as both the iPhone (being about 7 years old at this time) or Maiko's phone could give out at any time. Well, long story short\u2014I\u2019ve bought a Pixel 8a in white (porcelain?) color and have been tinkering with it since then."}),"\n",(0,n.jsx)(t.p,{children:"On the 14th, we went to Lake Ashi in Hakone. It was a beautiful place. Maiko's company friends also joined, and Maiko was the organizer. I think we were around 35 people in total, including kids. Maiko organized the whole thing\u2014salute to her. Maiko was looking after everyone, and I was looking after Tachan, so we didn't get any time to admire the view or even visit the lake on the 14th. Barbecue, drinks, and late-night chats with friends were good, though."}),"\n",(0,n.jsx)(t.p,{children:"Tachan had his first-year vaccine the week before. Though he had recovered from the vaccine fever on Monday, he seemed to have developed some stomach bug and had thrown up in the morning in the car and then threw up in the middle of the night and cried a lot. Worried, we headed back home early in the morning. Well, Lake Ashi\u2014we did come to see you but couldn't :gomenne: We headed home, and the rest of the crew decided to go fishing. Ah well, Tachan and his stomach bug :sweat-smile:"}),"\n",(0,n.jsx)(t.p,{children:"We had a nice ride home. Tachan tried vomiting a couple of times but didn\u2019t actually. He cried a bit but for the most part enjoyed and laughed on the way home. After returning the car, we went to the hospital in Musashi-Kosugi. The doctor told us that it\u2019s some stomach issue but is getting better. Relieved, we came home."}),"\n",(0,n.jsxs)(t.p,{children:["While heading home, I received a great news. My younger brother and sister-in-law had become parents to their first daughter. The whole family has been giving suggestions for names since then, but nothing is decided as of now. The baby was born through a c-section. Most of the ladies (Tachan as well) in the house were sick at the time. My ",(0,n.jsx)(t.code,{children:"badi Mm-ma"})," had an operation for kidney stones just a few days before, Mm-ma had a fever, ",(0,n.jsx)(t.code,{children:"badi bhabi"})," is also seeing the doctor about her ",(0,n.jsx)(t.code,{children:"rasodies"}),", and well, the new mother as well. Bloody coincidence."]}),"\n",(0,n.jsxs)(t.p,{children:["The baby was kept in NICU for a couple of days (this I got to know about a week later) but has been discharged and certified fit ","\ud83d\ude04"," now. Both the mother and baby are at home, and most of the other ladies in the house have recovered as well. Bloody coincidence."]})]})}function c(e={}){const{wrapper:t}={...(0,o.R)(),...e.components};return t?(0,n.jsx)(t,{...e,children:(0,n.jsx)(d,{...e})}):d(e)}},8453:(e,t,a)=>{a.d(t,{R:()=>s,x:()=>r});var n=a(6540);const o={},i=n.createContext(o);function s(e){const t=n.useContext(i);return n.useMemo((function(){return"function"==typeof e?e(t):{...t,...e}}),[t,e])}function r(e){let t;return t=e.disableParentContext?"function"==typeof e.components?e.components(o):e.components||o:s(e.components),n.createElement(i.Provider,{value:t},e.children)}}}]);